import React from 'react';
import logo from './images/bk_image.png'; 

import  '../App.css'


function homePage() {
  return (



    <div className="App">
      <header className="App-header">
        <img src={logo}  alt="logo" />
        <p>
         <code>SMS Gateway</code> 
        </p>

      </header>
    </div>
  );
}

export default homePage
